import {createRoot} from "react-dom";
import React from "react";

class Myfun extends React.Component{
  constructor(){
    super();

    this.state = {
      title:"count",
      value:0
    }
  }

  incrementValue = ()=>{
    this.setState({value:this.state.value+1});
  }
  render(){
    return(<>
    <h1>{this.state.title} : {this.state.value}</h1>
    <button onClick={this.incrementValue}>Increment</button>
    <button>Decrement</button>
    <button>Reset</button>
    </>);
  }
}

createRoot(document.getElementById("demo")).render(<Myfun/>);
